import { Component } from '@angular/core';
import { FormGroup } from '@angular/forms';

@Component({
  selector: 'app-add-registration',
  templateUrl: './add-registration.component.html',
  styleUrls: ['./add-registration.component.css']
})
export class AddRegistrationComponent {
  data = [
    { id: 1, name: 'John Doe', age: 30, input1: '', input2: '', input3: '' },
    { id: 2, name: 'Jane Smith', age: 28, input1: '', input2: '', input3: '' },
    { id: 3, name: 'Bob Johnson', age: 35, input1: '', input2: '', input3: '' },
    { id: 4, name: 'Alice Brown', age: 27, input1: '', input2: '', input3: '' }
  ];

  uploadData(item: any, index: any) {
    console.log('Data to Upload:', {
      id: item.id,
      name: item.name,
      age: item.age,
      input1: this.data[index].input1,
      input2: this.data[index].input2,
      input3: this.data[index].input3
    });
  }
}
